class Media {
  Media({
      this.type, 
      this.subtype, 
      this.caption, 
      this.copyright, 
      this.approvedForSyndication, 
      this.mediametadata,});

  Media.fromJson(dynamic json) {
    type = json['type'];
    subtype = json['subtype'];
    caption = json['caption'];
    copyright = json['copyright'];
    approvedForSyndication = json['approved_for_syndication'];
    if (json['media-metadata'] != null) {
      mediametadata = [];
      json['media-metadata'].forEach((v) {
        mediametadata?.add(MediaMetadata.fromJson(v));
      });
    }
  }
  String? type;
  String? subtype;
  String? caption;
  String? copyright;
  int? approvedForSyndication;
  List<MediaMetadata>? mediametadata;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['type'] = type;
    map['subtype'] = subtype;
    map['caption'] = caption;
    map['copyright'] = copyright;
    map['approved_for_syndication'] = approvedForSyndication;
    if (mediametadata != null) {
      map['media-metadata'] = mediametadata?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

